INSERT INTO `products` (`productid`, `productt_pic`, `product_name`, `product_unit`, `product_price`, `product_price2`, `product_intro1`, `lang`, `seq`) VALUES
(1, '1360654651_1.jpg', '高麗菜豬肉水餃  (50入)', '一包50入', 300, 275, '<p class=\"p1\"><span class=\"s1\">嚴選優質新鮮高麗菜</span><span class=\"s2\">.</span><span class=\"s1\">與優質豬肉</span><span class=\"s2\">.</span><span class=\"s1\">再以傳統手工方式製作</span><span class=\"s2\">.</span><span class=\"s1\">每一粒都是扎實淳實的美味</span><span class=\"s2\">.</span><span class=\"s1\">值得您一嘗</span><span class=\"s2\">.50</span><span class=\"s1\">入/225</span><span class=\"s1\">元。</span></p>', 1, 0),
(2, '1359041831_2.jpg', '蔥燒水餃                         (50入)', '一包50入', 325, 300, '&nbsp;您喜愛不一樣的特殊口味嗎？蔥燒的濃郁口味是喜愛重口味的您最好的選擇。40入/220元。', 1, 4),
(3, '1359041852_3.jpg', '韭菜水餃                         (50入)', '一包50入', 300, 275, '&nbsp;嚴選優質新鮮韭菜．濃郁鮮美的韭菜滋味．與扎實的內料．是喜愛韭菜的您最好的選擇。50入/225元', 1, 1),
(4, '1359042765_4.jpg', '玉米水餃                         (50入)', '一包50入', 300, 275, '&nbsp;嚴選優質豬後腿肉與超甜玉米．讓豬肉的油脂與玉米的甜在口中交織出最棒的口感．值得您一試 50入/225元。', 1, 2),
(5, '1359042794_5.jpg', '素食水餃                         (50入)', '一包50入', 325, 300, '<p class=\"p1\">嚴選優質新鮮高麗菜內料．以純素食的內料．專為素食者貼心的服務。40入<span class=\"s1\">/220</span>元。</p>', 1, 3),
(6, '1542866877_6.jpg', '招牌水餃 (50入)', '一包50顆', 325, 300, '&nbsp;招牌水餃（高麗菜和韭菜混搭呈現出不ㄧ樣的味道）', 1, 5),
(7, '', '餛飩                         (30入)', '一盒', 80, 60, '&nbsp;新鮮黑豬肉內餡。', 1, 6);
